# frozen_string_literal: true

require "debug"

input = <<~INPUT
  MMMSXXMASM
  MSAMXMSMSA
  AMXSXMAAMM
  MSAMASMSMX
  XMASAMXAMM
  XXAMMXXAMA
  SMSMSASXSS
  SAXAMASAAA
  MAMMMXMMMM
  MXMXAXMASX
INPUT

input = DATA.read
rows  = input.split("\n").map(&:chars)
range = (1..rows.length)
count = 0

range.each do |row_i|
  range.each do |col_i|
    next unless rows.dig(row_i, col_i) == "A" # point

    cross = [
      rows.dig(row_i - 1, col_i - 1), # top left
      rows.dig(row_i - 1, col_i + 1), # top right
      rows.dig(row_i + 1, col_i - 1), # bottom left
      rows.dig(row_i + 1, col_i + 1) # bottom right
    ]

    next unless %w[SMSM MSMS SSMM MMSS].include?(cross.join)

    count += 1
  end
end

puts count # 1948

__END__
